  function getFromStorage(name) {
    try {
      let val = localStorage.getItem(name);
      if (val) return val;
    } catch (e) {
    }
  }

  function setToStorage(name, val) {
    try {
      if(name === 'allDoneWords'){
        localStorage.setItem('time', getSec() );
      }
      localStorage.setItem(name, val);
    } catch (e) {}
  }

