    'буриме': 'Буриме - литературная игра, заключающаяся в сочинении стихов, чаще шуточных, на заданные рифмы, иногда ещё и на заданную тему.',
    'униат': 'Униат - приверженец униатской (греко-католической) церкви.',
    'танбур': 'Танбур - восточный струнный щипковый музыкальный инструмент',
    'вертун': 'Вертун - 1) проф. голубь, перевёртывающийся в полёте через голову или крыло.2) Голубь особой породы; турман. 3) разг. вращающееся приспособление, устройство с вращающейся частью.',
    'трибун': 'Трибун - общественный деятель блестящий оратор и публицист',
    'корка': '<p>Корка</p> <ul><li>Кожура нек-рых плодов, фруктов</li><li> Наружный твёрдый слой хлеба. Чёрствая корка.</li><li>Затвердевший слой чего-н. Рана покрылась коркой.</li><li>Верхняя, отсыхающая часть коры</li><li>Одна из двух поверхностей переплета (в 1 знач.). Прочитать книгу от корки до корки (от начала до конца, ничего не пропуская)</li></ul>',
