    'силовик': 'Силовик - представитель правоохранительных органов, разведывательных организаций, вооружённых сил и прочих государственных структур, которым государство делегирует своё право на применение силы (эти организации принято называть силовые министерства, силовые ведомства, силовые структуры)',
